import React from 'react';
import './Input.module.css';

interface InputProps {
    criteria: string;
}

const Input: React.FC<InputProps> = ({ criteria }) => {
    return (
        <>
            <input id={criteria} />
            <label htmlFor={criteria}>{criteria}</label>
        </>
    );
};

export default Input;
